import React from 'react';
import { View, TouchableOpacity, Text, TextInput } from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { Entypo } from '@expo/vector-icons';
import Bottom from '../Components/Bottom';



function Search(props) {
    const navigation = props.navigation
    const [Search, setSearch] = React.useState(null);
    return (
        <View style={{
            height: '100%',
        }}>
            <View style={{
                height: 90,
                width: '100%',
                backgroundColor: 'white',
                flexDirection: 'row',
            }}>
                <View style={{
                    height: 50,
                    marginTop: 30,
                    marginLeft: 20,
                    width: '100%',
                    borderColor: '#808080',
                    borderWidth: 1,
                    borderRadius: 25,
                    flexDirection: 'row',
                    flex: 4,
                }}>
                    <Ionicons style={{
                        marginLeft: 10,
                        marginTop: 10,
                        flex: 1,
                    }} name="search" size={24} color='#1C2348' />
                    <TextInput onChange={setSearch} placeholder='Search' style={{
                        height: 50,
                        borderRadius: 25,
                        width: '70%',
                        flex: 4,



                    }}>

                    </TextInput>
                    <TouchableOpacity style={{
                        flex: 1,
                        marginTop: 10,
                        marginLeft: '10%'

                    }}>
                        <Entypo name="circle-with-cross" size={24} color='#1C2348' />
                    </TouchableOpacity>

                </View>
                <TouchableOpacity style={{
                    marginTop: 45,
                    marginLeft: 10,
                    flex: 1,
                }}>
                    <Text>
                        Cancel
                    </Text>
                </TouchableOpacity>

            </View>
            <Bottom style={{
                marginTop: 800,
                backgroundColor:'red',
            }}>

            </Bottom>

        </View>

    );
}

export default Search;
